import { Route, Routes,Switch } from 'react-router';
import Button from './Buttons/Button';
import About from './Pages/About';




function App() {
  return (
    <div>
      <Routes>
        <Switch>
          {' '}
          <Route path="/" element={<Button></Button>} />
        </Switch>
<Switch></Switch>
        <Route path="/about" element={<About></About>} />
      </Routes>
    </div>
  );
}

export default App;
